import React from 'react';
import s from './Dialog.module.css'
const Dialog = () =>{
    return (
       <div>
           <div className={s.Dialog_container}>
           <div className={s.name_dialogs}>
               <div>Mike</div>
               <div>Sasha</div>
               <div>Dima</div>
               <div>Tola</div>
               <div>Ylia</div>
           </div>
           <div>dialoitem</div>
           </div>
       </div>
    );
}
export default Dialog;
